import './App.css';
import { Route,Routes } from 'react-router-dom';
import Home from "./pages/Home"
import Blog from "./pages/Blog"

function App() {
  return (
    <div>
      <Routes>
        <Route path='/' element={<Home/>} />
        <Route path='/:id' element={<Blog/>} />
      </Routes>
    </div>
  );
}

export default App;
